import { Component } from "react";
import libuser from "../lib/user";


export default class Header extends Component {
    constructor(props) {
        super(props)
    }

    render() {

        const user = libuser.get();

        return (
            <header>
                <img id="#nav-logo" />
                <nav>
                    <ul>
                        <li>Home</li>
                        <li>Calendar</li>
                        <li>Search</li>
                        {user && (<li>Account</li>)}
                        {user && (<li>Loggout</li>)}
                        {!user && (<li>Login</li>)}
                    </ul>
                </nav>
            </header>
        );
    }
}
